void sort(int array[], int size)
{
    bool sorted = true;
    int carry{0};

    for (size_t i = 0; i < size; i++)
    {
        sorted = true;
        for (size_t j = 0; j < size - 1; j++)
        {
            if (array[j] > array[j + 1])
            {
                carry = array[j];
                array[j] = array[j + 1];
                array[j + 1] = carry;
                sorted = false;
            }
        }
        if (sorted)
        {
            break;
        }

        
    }
}
